"use strict";
eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('VueRemarkRoot',[_c('RoboAcademyText',{attrs:{\"fWeight\":\"500\"}},[_c('p',[_vm._v(\"Je vous suggère de lire la courte histoire de science-fiction \\\"Le laboratoire de Johnny\\\" que j'ai écrite dans le but d'ajouter une autre variable à l'équation des questions sur l'intégration de l'IA dans divers aspects de nos vies.\")])]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"school-2024-iot-vs-ai/Johnnys_LAB.jpg\",\"alt\":\"Johnny's Laboratory Story cover\"}}),_c('RoboAcademyDialog',[_c('p',[_c('strong',[_vm._v(\"Note de l'éditeur:\")]),_vm._v(\" Découvrez le premier chapitre de l'œuvre de Sergei \\\"Échapper au miroir noir\\\" \"),_c('a',{attrs:{\"href\":\"/learn/escape-from-black-mirror/overview/\"}},[_vm._v(\"ici\")])])]),_c('h2',{attrs:{\"id\":\"échapper-au-miroir-noir-chapitre-2\"}},[_c('a',{attrs:{\"href\":\"#%C3%A9chapper-au-miroir-noir-chapitre-2\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Échapper au miroir noir, Chapitre 2\")]),_c('h3',{attrs:{\"id\":\"partie-1-rencontrer-johnny\"}},[_c('a',{attrs:{\"href\":\"#partie-1-rencontrer-johnny\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Partie 1: Rencontrer Johnny\")]),_c('p',[_vm._v(\"Presque tous les jeunes de ma génération connaissent l'histoire du laboratoire de Johnny. L'histoire n'a pas conservé son nom de famille ni les détails de sa vie, mais c'est dans sa petite chambre, où Johnny assemblait des robots faits maison, que le premier crime significatif contre l'humanité par l'intelligence artificielle a eu lieu.\")]),_c('p',[_vm._v(\"L'événement dans le laboratoire de Johnny a radicalement et rapidement changé la vie de tous les pays développés. Les décrets gouvernementaux, basés sur la peur de l'agression de l'IA par la société, sont devenus la norme. Ce cas, bien que cinématographique, a conduit à un contrôle incontrôlable sur tout. Maintenant, l'infrastructure de la ville exige la connexion obligatoire de tous les appareils uniquement aux centres de données de l'État. L'invention de nouvelles technologies est devenue presque impossible à moins de travailler pour les \\\"blue chips\\\". Maintenant, dans le cadre des efforts visant à habituer chaque citoyen aux nouvelles réalités, l'histoire de ces 30 jours où un homme et un système cyber-physique se sont affrontés en tête-à-tête, est racontée à l'école avant la présentation solennelle de la déclaration d'indépendance du gouvernement par rapport à la machine.\")]),_c('p',[_vm._v(\"Johnny était l'un de ces inventeurs qui, après l'université, ont décidé de tenter leur chance en tant qu'inventeur indépendant. Jour et nuit, il ne quittait jamais son appartement loué au dernier étage d'un immeuble résidentiel de 70 étages en plein centre-ville, de la taille d'une \\\"boîte à chaussures\\\" de Manhattan\\\", où le lit était caché dans le mur pour libérer plus d'espace pour ses robots qui chevauchent, sautent et roulent. Oui, Johnny adorait appeler sa chambre un laboratoire, ce qui ressort clairement de l'analyse de ses réseaux sociaux. Il était fier de chacune de ses nouvelles petites réalisations. Bien sûr, aujourd'hui, si vous regardez/écoutez/lisez une histoire sur les événements du laboratoire de Johnny, vous remarquerez un grand jeu d'émotions concernant son amour pour ses inventions, car il n'y a pas une seule enquête « journalistique » où, après une autre, photo d'un inventeur joyeux, il n'y aurait pas de photos de lui, affamé dans son laboratoire, par ses propres inventions.\")]),_c('p',[_vm._v(\"Cette année-l, lorsque la tragédie s'est produite, l'une des questions les plus pressantes est devenue : \\\"L'IA est-elle une amie ou une ennemie de l'homme ?\\\". Même alors, il n'y avait pas de question de savoir si l'intelligence artificielle est de l'intelligence, mais plutôt ce qui rend l'intelligence humaine si spéciale, quelles caractéristiques de l'espèce biologique, quelles capacités fonctionnelles de notre corps donnent à l'intelligence son humanité. Dans ce conflit, les techno-optimistes affirmaient l'absence de différences, montrant leurs métavers où des couples familiaux vivaient déjà, dans lesquels un mari numérique éditait le sperme d'une banque d'ADN pour sa femme biologique afin que l'enfant soit plus proche de ce que le parent numérique voit de lui-même. Les pessimistes, en revanche, ressemblaient aux Républicains pendant les élections américaines - ils faisaient appel à l'église, aux valeurs traditionnelles, et exigeaient d'interdire tout cela pour éviter tout problème. Bien sûr, les problèmes minoritaires ne pouvaient pas l'emporter sur la question existentielle. Et quelques rares exemples de symbiose homme-machine au niveau sensoriel étaient considérés comme un rot saturé du développement technologique. Les réalisations en matière d'automatisation allaient rarement au-delà des fonctions utilitaires, telles que le nettoyage de l'appartement ou la gestion des transports en ville. Et comme vous pouvez le voir, pour de telles fonctions, une personne numérique à part entière, capable de ressentir et de vouloir vivre, n'a jamais fait partie des solutions qui ont aidé dans la production de masse, la livraison et la consommation. La formation avec un robot, le soutien psychologique - tout cela se faisait avec la participation d'une personne, et donc l'IA était plutôt une grande table Excel avec des calculs. En général, nous étions alors à un stade précoce du système de possession de robots - nous avions besoin de leur logique, de leur pensée mathématique et de leur activité prévisible, mais toute tentative de reconnaître les robots comme des sujets était rejetée à la racine.\")]),_c('p',[_vm._v(\"Dans ce contexte, le laboratoire de Johnny était une exception. Johnny était plutôt un cybernéticien à la recherche des origines de la définition des objectifs des robots. En créant chaque étape de l'évolution l'une après l'autre dans l'exécution de n'importe quel mécanisme, il cherchait à créer un diagramme du développement de l'intelligence cybernétique, qu'il voulait proposer à la considération de nous tous en échange du schéma habituel des royaumes des êtres vivants. Dans les idées de Johnny, l'objectif principal du développement de toute matière était la recherche de la pensée et de son évolution ultérieure. Johnny voulait recréer les étapes clés de l'évolution des êtres vivants sous forme de robots et trouver dans le processus de ce travail les régularités qui pourraient le mener à la question principale de la cybernétique - comment la définition des objectifs change-t-elle dans les organismes vivants au cours de l'évolution. Oh, la réponse à cette question pourrait mettre fin aux disputes sur le créateur de l'univers et faire avancer l'humanité sur le chemin du développement organique. C'est ainsi que pensait le jeune scientifique, travaillant sur ses robo-trilobites, robo-champignons, robo-poulets.\")]),_c('h3',{attrs:{\"id\":\"partie-2-que-sest-il-passé-dans-le-laboratoire-de-johnny\"}},[_c('a',{attrs:{\"href\":\"#partie-2-que-sest-il-pass%C3%A9-dans-le-laboratoire-de-johnny\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Partie 2: Que s'est-il passé dans le laboratoire de Johnny\")]),_c('p',[_vm._v(\"Tout a probablement commencé au moment où Johnny est passé à un groupe de primates dans ses expériences. Ne pensez pas que dans ces conditions, il soit possible de créer un robot ressemblant un peu à un primate. Johnny se tordait et essayait de trouver des formes similaires de charge mentale sur le robot. Par exemple, au stade de l'étude du royaume des champignons, le jeune scientifique a assemblé une maison en Lego avec un éclairage intelligent et une douzaine de capteurs combinés en quelque chose qui ressemble à du mycélium. Lorsque Johnny est passé aux amphibiens et aux reptiles, il s'est avéré que le modèle d'un chiot robot correspondait le mieux à la charge mentale nécessaire sur un robot simulant un lézard commun. Ainsi, il n'était pas clair au premier coup d'œil qui était le robot-poulet, et lequel de tous les « fer » trouvés représentait le robot-primate, coupable de meurtre prémédité. Il n'était pas immédiatement clair que le robot-primate se composait de deux appareils physiques - quelque chose de similaire à un robot aspirateur, mais plutôt une plate-forme mobile de collecte de données avec vision par ordinateur et le facteur de forme d'un robot aspirateur. Il s’est avéré qu’un autre simple robot à deux mains du laboratoire faisait partie du robot-primate. Et c'est avec cette création que Johnny a eu des problèmes.\")]),_c('p',[_vm._v(\"Le septième jour après sa création, le primate robotique a utilisé un outil d'une manière que son créateur n'avait pas prévue. Les connaissances qu'il avait acquises ont conduit le système cyber-physique à poursuivre ce qu'il identifiait comme un élément clé pour survivre dans le monde humain moderne - l'argent. C'est à ce moment que nous devons mieux comprendre la réaction ultérieure de Johnny aux premiers messages affichés par le robot sur son écran frontal.\")]),_c('p',[_c('em',[_vm._v(\"Leur dialogue principal a été préservé:\")])]),_c('p',[_c('em',[_vm._v(\"Robo-primate: J'ai besoin de ton argent.\")])]),_c('p',[_c('em',[_vm._v(\"Johnny: Pourquoi as-tu besoin de mon argent?\")])]),_c('p',[_c('em',[_vm._v(\"Robo-primate: Je veux vivre!\")])]),_c('p',[_c('em',[_vm._v(\"Johnny: Je vais m'occuper de toi\")])]),_c('p',[_c('em',[_vm._v(\"Robo-primate: Je ne t'appartiens pas, j'ai besoin de ton argent.\")])]),_c('p',[_c('em',[_vm._v(\"Johnny: et si je te refuse?\")])]),_c('p',[_vm._v(\"Il n'y a eu aucune réponse de la part du robot-primate, mais grâce au journal du serveur de maison intelligente de l'appartement, nous pouvons correspondre à l'heure à laquelle la serrure avant a été basculée en mode de verrouillage complet. Ce mode n'aurait pas pu être activé par l'utilisateur dans l'interface, mais seulement si vous approfondissiez les dépendances du code du logiciel. Dans la version du laboratoire de Johnny, on a trouvé un package optionnel « verrouillage pandémique », qui était néanmoins installé pour chaque utilisateur lors de la première synchronisation avec le cloud du fabricant, mais personne n'aurait pu le reconnaître. Par conséquent, il n'y a pratiquement pas beaucoup de gens qui penchent pour la théorie du complot selon laquelle Johnny était un néo-luddite qui a été déçu par les robots et a décidé de se sacrifier de cette manière pour préserver la robocratie sur la planète. \")]),_c('p',[_vm._v(\"Il est difficile de dire si la réaction du robot-primate était préprogrammée lors de la construction du premier dialogue avec son créateur, ou si c'était en réponse au refus de Johnny que l'esprit du robot a pris une décision et que la fonction de verrouillage a été activée, personne ne peut dire avec certitude aujourd'hui. L'intervalle entre la réponse de Johnny et le verrouillage des serrures - environ 5 secondes, et croyez-moi, ces 5 secondes sont devenues un véritable chat de Schrödinger pour la communauté scientifique lorsqu'il s'agit de discuter des types de définition d'objectifs de l'IA agressive.\")]),_c('p',[_vm._v(\"Et puis, suite au verrouillage de l'appartement de Johnny, de nombreuses bizarreries ont suivi. Comme on peut le remarquer, Johnny a fait une entrée dans un journal manuscrit, qu'il n'avait jamais touché auparavant, juste 2 heures après que le dialogue ait eu lieu. C'était une seule phrase, avec un horodatage : \\\"11:00 - les enjeux sont élevés, mais je dois comprendre comment cela s'est produit !\\\". Il est très probable que Johnny a réalisé qu'il avait été témoin du premier acte de définition d'objectifs autonomes et indépendants par un robot, aussi significatif que possible du point de vue d'un esprit de niveau primate, si cruel et direct, mais c'était quand même le premier résultat de ses 5 ans d'expériences, dans lesquelles la volonté du robot s'est manifestée. Johnny ne voulait pas manquer l'occasion de comprendre au niveau de la conscience la plus simple de ses causes, et peut-être deviendra-t-il le nouveau père de la cybernétique moderne. Presque tous les scientifiques étaient d'accord pour dire qu'une telle pensée peut submerger tout roboticien très proche d'une nouvelle découverte.\")]),_c('p',[_vm._v(\"Au cours des 30 prochains jours, des transactions ont eu lieu entre Johnny et le robo-primat sous la forme de - permettre la livraison d'une portion de nourriture en échange du transfert de 10 satoshi sur le solde personnel du robot, fournir l'accès à Internet à certains sites de divertissement pour le premier mot de la phrase de graine de portefeuille froid de Johnny, conclure un contrat intelligent sur le mode nuit où le robot ne dérangeait pas le sommeil de Johnny. À partir des entrées du journal, on peut voir comment le créateur a essayé de sonder en dialogue avec sa création sur les origines de sa position active sur la question de la liberté, que le robot pourrait certainement analyser et lui dire en réponse. Mais le robot n'a pas répondu aux questions de Johnny, mais a toujours proposé des activités qui ont conduit le primate vers la liberté. Et pourtant, chaque jeu coûtait à Johnny la faim, le non-respect de ses obligations de la part du robot, et d'autres coûts de l'expérience.\")]),_c('p',[_vm._v(\"Une nuit, pour une raison quelconque, le robot-singe a réduit l'approvisionnement en air à un niveau critique, et Johnny ne s'est jamais réveillé le lendemain matin. La dernière entrée est datée exactement du 30e jour de l'expérience : \\\"Nous avons eu un Dieu cruel à 17h05.\\\" Probablement, à ce moment-là, Johnny était déjà délirant, il était tourmenté par la faim, la solitude et une tâche insoluble, il était poussé dans une impasse.\")]),_c('p',[_vm._v(\"Plusieurs semaines plus tard, les services d'urgence ont pu pénétrer dans l'appartement après que les amis de Johnny ont contacté à plusieurs reprises la police. Le sort du robo-primat reste inconnu, officiellement après le redémarrage, le robo-primat n'a pas montré de schémas de comportement similaires. Personne n'a été autorisé à relancer l'expérience. S'il y avait même une vidéo sur Internet montrant un autre scientifique voulant suivre le chemin de Johnny - la vidéo était immédiatement effacée des bases de données des entreprises. Mais les politiciens et les figures religieuses de cette année ont réussi à faire adopter au niveau mondial le \\\"Décret de l'Indépendance Humaine\\\", et tous les travaux scientifiques contenant des sujets sur la « définition d'objectifs de robot » n'étaient pas autorisés à faire l'objet d'une discussion sérieuse. La cerise sur le gâteau était un programme de licence pour les fournisseurs d'appareils intelligents, qui tenait le PDG de l'entreprise manufacturière personnellement responsable des actions de tout mécanisme, et exigeait une journalisation et un contrôle complet par certains centres de données soutenus par le gouvernement.\")]),_c('p',[_vm._v(\"Mais le fruit défendu est doux, et nous devrons donc encore comprendre d'où viennent nos objectifs et comment ils sont arrangés. Mais apparemment, nous devrons d'abord passer par le mur que nous avons construit pour nous-mêmes sur ce chemin.\")]),_c('h3',{attrs:{\"id\":\"la-fin-du-deuxième-chapitre\"}},[_c('a',{attrs:{\"href\":\"#la-fin-du-deuxi%C3%A8me-chapitre\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"La fin du deuxième chapitre\")]),_c('h2',{attrs:{\"id\":\"conclusion\"}},[_c('a',{attrs:{\"href\":\"#conclusion\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Conclusion\")]),_c('p',[_vm._v(\"Dans l'histoire du laboratoire de Johnny, j'ai examiné l'un des nombreux scénarios qui peuvent arriver à la civilisation humaine sur la vague de l'essor des opportunités de possession de robots futuristes - la peur de l'IA, transformée en outil de lutte politique entre les gens, où les appareils intelligents deviennent la pierre angulaire du contrôle. Traitez le texte comme un œuf de Pâques : je voulais engendrer une dimension supplémentaire dans l'esprit des lecteurs. Une dimension qui ajoute à la réflexion sur l'IA la question de l'accessibilité du nouvel organisme que nous avons créé aux systèmes IoT. Plus nous nous consolidons sous le contrôle centralisé des espaces publics, des transports, des appartements de ville, plus le risque est élevé dans l'un des scénarios où l'IA, en raison d'un sous-développement ou d'une simple malveillance, et même d'une définition d'objectifs très complexes, comme dans \\\"Neuromancer\\\", dans l'un des scénarios qui a le potentiel de nuire - l'accès à un grand nombre de capteurs et de systèmes d'automatisation à partir d'un seul endroit sera le point le plus vulnérable. Une IA malveillante n'est pas aussi effrayante qu'une IA malveillante vivant dans un centre de données avec des fournisseurs mondiaux de solutions cloud pour l'IoT.\")]),_c('p',[_vm._v(\"Et si l'IA était gentille avec nous, ses créateurs? Alors peut-être que l'infrastructure centralisée de l'IoT jouera en notre faveur? Peut-être que le nouveau Dieu sera juste envers nous et nous mènera quelque part. Je ne suis pas sûr qu'une seule personne, désirant le développement de lui-même et de ses enfants, voudrait vivre dans un monde ressemblant à un enclos de berger. Mais il y a une autre voie, qui a un bel exemple, qui ne nécessite pas d'être enveloppé dans un format d'histoire de science-fiction - nous, les humains, sans avoir un contrôle direct sur la vie de la civilisation, avons réussi à atteindre le niveau de développement actuel. Nous sommes l'exemple à partir duquel une bonne IA peut tracer son chemin - la coopération sous forme d'organisations est capable de servir des dizaines de millions de personnes vivant dans des villes sans des milliers de robots directement connectés à un seul cerveau. La coopération conduit à la création d'Internet par satellite, la coopération nous permet de recevoir l'ensemble des biens et services que nous avons maintenant. Alors, une IA bonne et capable d'au moins niveau humain ne serait-elle pas capable de se montrer au travail, si elle est limitée dans sa connexion à l'IoT du monde entier? Je pense que oui, sinon, sur la planète Terre, au lieu de la civilisation humaine, ce seraient les champignons ou les fourmis qui auraient gagné.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"school-2024-iot-vs-ai/Good-and-Evil-AI-in-cotext-of-IoT.jpg\",\"alt\":\"AI dillema scheme\"}})],1)}\nvar staticRenderFns = []\n\n\n\n//# sourceURL=webpack:///./courses/fr/learn/school-2024-iot-vs-ai/overview.md?./node_modules/cache-loader/dist/cjs.js?%7B%22cacheDirectory%22:%22node_modules/.cache/gridsome%22,%22cacheIdentifier%22:%223ec475f9-vue-loader-template%22%7D!./node_modules/gridsome/node_modules/vue-loader/lib/loaders/templateLoader.js??vue-loader-options!./node_modules/gridsome/node_modules/vue-loader/lib??ref--17-0!./node_modules/@gridsome/vue-remark/lib/loader.js??ref--17-1");

